(25501, 'Q 300', 'Camembert', 'Camembert', 'Cheese', '1 kg', 'Market', 'CAMEMBERT  DOUBLE CREAM 1.0 kg', 2, 18, 'Active', 'Yes', 'QUEBEC', '', 'M - Cheese', '', '', '02/09/2010', '28/08/2011', 'Double cream', '', '', '', '', '0.00', '20261', 3.99, '', '', '', '', '', '20261', 'Chris Klugman', 'Chris Klugman', 100.00, '0', 'No'),
(25502, 'Q 670', 'Cendre des Pres', 'CendrePres', 'Cheese', '1.8 kg', 'Market', 'CENDRE DES PRES, 1.8 kg', 3, 18, 'Active', 'Yes', 'QUEBEC', '', 'M - Cheese', '', '', '23/09/2010', '28/08/2011', 'A unique product, this artisanal cheese is made of cow milk and possesses a bloomy rind. A line of maple wood ash lends this cheese an exceptional taste of farm fresh butter.', '', 'Cow''s Milk', '', 'Quebec', '0.00', '20262', 4.25, '', '', '', '', '', '20262', 'Chris Klugman', 'Chris Klugman', 100.00, '0', ''),
(25510, 'Q 470', 'Baluchon', 'Baluchon', 'Cheese', '1.8 kg', 'Market', 'LE BALACHON RAW MILK 1.8 KG.', 4, 14, 'Active', 'Yes', 'QUEBEC', '', 'M - Cheese', '', '', '23/09/2010', '28/08/2011', 'Based on an Oka-style recipe, Baluchon is an organic, raw milk, washed rind cheese that is aged a minimum of 60 days. It has a semi-firm, and moist paste and a slight sheen to its butter-yellow colour. The aroma is fresh, creamy and barny. The flavour ni', '', 'Organic Raw Cow''s Milk', '', 'Quebec', '0.00', '20270', 6.99, '', '', '', '', '', '20270', 'Chris Klugman', 'Chris Klugman', 100.00, '0', ''),
(25536, 'FRB 120', 'Bleu D''Auvergne', 'BlueDAuvergne', 'Cheese', '2.2 kg', 'Market', 'BLEU D''AUVERGNE 2.2 kg', 5, 35, 'Active', 'Yes', 'FRENCH', '', 'M - Cheese', '', '', '15/10/2010', '28/08/2011', 'Bleu d''Auvergne is made in the traditional manner from cow''s milk and features blue veining throughout. Its moist, sticky rind conceals a soft paste possessing a grassy, herbaceous, and (with age) spicy, pungent taste.', '', 'Raw Cow''s Milk', '', 'France', '0.00', '20296', 5.19, '', '', '', '', '', '20296', 'Chris Klugman', 'Chris Klugman', 100.00, '0', ''),
