(25568, 'GEF470', 'Le Marechal', 'LeMarechal', 'Cheese', '7.5 kg', 'Market', 'LE MARECHAL, Artisinal, Cave aged, Herb, Raw milk, 7.5 kg', 8, 18, 'Active', 'Yes', 'SWISS', '', 'M - Cheese', '', 'Switzerland', '06/12/2010', '28/08/2011', 'This hard cheese, made from pure milk, has a subtle but rustic flavour, thanks to the herbs sprinkled on it while it matures.', '', 'Unpasteurized Cow''s Milk', '', 'Switzerland', '0.00', '20328', 5.99, '', '', '', '', '', '20328', 'Chris Klugman', 'Chris Klugman', 100.00, '0', 'No'),
