(27391, '', 'Figaro', 'GlengarrFigar', 'Cheese', '', 'Market', 'Glengarry Cheesemaking - Figaro 200g - Bloomy rind soft cheese', 22, 11, 'Active', 'Yes', '', '', 'M - Cheese', '', '', '01/08/2010', '28/08/2011', 'At two to three weeks old, the cheese will be mild and milky with a fresh, mushroomy taste and as it ages it will start to ripen and become fondue-like under the crust. It will get more of a bouquet on it and the rind will go from white to a golden col', '', 'Cow''s Milk', '', 'Ontario', '0.00', '27391', 13.79, '', '', '', '', '', '27391', 'Jon', 'Chris Klugman', 0.00, '0', 'No'),
