(32700, '', 'Smoked Gruyere', 'GruyereSmoked', 'Cheese', '', 'Market', '', 656, 39, 'Active', 'Yes', '', '', 'M - Cheese', '', '', '07/08/2010', '10/09/2011', 'Gruyere is named after a Swiss village. It is traditional, creamery, unpasteurized, semi-soft cheese. The natural, rusty brown rind is hard, dry and pitted with tiny holes. The cheese is darker yellow than Emmental but the texture is more dense and compa', '', 'Cow''s Milk', '', 'Switzerland', '0.00', '32700', 3.99, '', '', '', '', '', '32700', 'Jon', 'Chris Klugman', 0.00, '', ''),
(32701, '', 'Fiery Spicy Cheddar', 'CheddarSpicy', 'Cheese', '', 'Market', '', 657, 39, 'Active', 'Yes', '', '', 'M - Cheese', '', '', '07/08/2010', '28/08/2011', 'Hot! Hot! Hot! This cheese is not for the faint hearted and blows the stereotype of us Brits being reserved out of the water!\r\rA fiery blend of English cheese, red and green peppers and chillis makes this cheese and unusual addition to any cheese board.', '', 'Cow''s Milk', '', 'UK', '0.00', '32701', 5.29, '', '', '', '', '', '32701', 'Jon', 'Chris Klugman', 0.00, '', ''),
(32702, '', 'Mature Cheddar', 'CheddarMature', 'Cheese', '', 'Market', '', 658, 39, 'Active', 'Yes', '', '', 'M - Cheese', '', '', '07/08/2010', '28/08/2011', 'A simple aged cheddar, great to impress any casual cheese eater or an experienced cow''s milk cheese lover.', '', 'Cow''s Milk', '', 'UK', '0.00', '32702', 4.99, '', '', '', '', '', '32702', 'Jon', 'Chris Klugman', 0.00, '', ''),
(32703, '', 'Coconut Cheese', 'CheddarCoconut', 'Cheese', '', 'Market', '', 659, 39, 'Active', 'Yes', '', '', 'M - Cheese', '', '', '07/10/2010', '28/08/2011', 'Kokos Coconut Cheese - a unique cheese that really tastes like Coconut! The texture is smooth and sliceable. Coconut is known for it''s nutritional content and many health benefits. The combination of healthy coconut with cheese as a good source of calciu', '', 'Cow''s Milk', '', 'Holland', '0.00', '32703', 4.59, '', '', '', '', '', '32703', 'Chris Klugman', 'Chris Klugman', 0.00, '', ''),
(32704, '', 'Edam', 'EdamCheese', 'Cheese', '', 'Market', '', 660, 39, 'Active', 'Yes', '', '', 'M - Cheese', '', '', '07/10/2010', '28/08/2011', 'The spherical shape and bright red wax coating make Edam one of the most recognized imported cheeses. Made from skimmed cow''s milk, Edam is smooth and supple with a slight aftertaste.', '', 'Cow''s Milk', '', 'Holland', '0.00', '32704', 3.29, '', '', '', '', '', '32704', 'Chris Klugman', 'Chris Klugman', 0.00, '', ''),
(32705, '', 'French Double Cream Brie', 'BrieFrnchDblCrm', 'Cheese', '', 'Market', '', 661, 1, 'Active', 'Yes', '', '', 'M - Cheese', '', '', '07/10/2010', '28/08/2011', 'This is a double cr?me soft cheese, rich in butter, whose rind is lightly covered with a white fuzz that hints of mushrooms. As delicious as Brie Claudel, its unctuousness is, however, incomparable.', '', 'Cow''s Milk', '', 'France', '0.00', '32705', 4.99, '', '', '', '', '', '32705', 'Chris Klugman', 'Chris Klugman', 0.00, '', ''),
